import React, { Component } from "react";
import "../styles/About.css";
import banner from "../tree.png";

export default class Contact extends Component {
  render() {
    return (
      <div>
        <div className="about_title">
          <h1 className="about_title_text">About Me</h1>
          <div className="activities_container">
            <h2 className="about_title_subtext1">
              Currently, I am a senior majoring in Information Science and
              English at Cornell University's College of Arts &amp; Sciences.
            </h2>
            <img className="tree" src={banner} alt="" />
            <h2 className="about_title_subtext1">
              I am part of The Cornell Daily Sun's Web Team.
            </h2>
          </div>
        </div>
      </div>
    );
  }
}
